import React, {Component} from 'react';

class Stopwatch extends Component {
    state= {
        isRunning : false
    }
    render (){
        return(
            <div className="stopwatch">
                <h2>Stopwatch</h2>
                <span className="stopwatch-time"></span>
                <button>{this.state.isRunning ? 'Stop': 'Start'}</button>
                <button>Reset</button>                
            </div>
        );
    }
}

export default Stopwatch;
